#
# Structure for the `recept_det` table : 
#

CREATE TABLE `recept_det` (
  `nRec` int(11) NOT NULL AUTO_INCREMENT,
  `nRecept` int(11) NOT NULL COMMENT 'Описание рецепта',
  `nProduct` int(11) NOT NULL COMMENT 'Ингредиенты',
  `Val` float(9,3) NOT NULL,
  PRIMARY KEY (`nRec`),
  KEY `nProducts` (`nProduct`),
  KEY `nRecept` (`nRecept`),
  CONSTRAINT `recept_det_fk` FOREIGN KEY (`nRecept`) REFERENCES `recept` (`nRec`),
  CONSTRAINT `recept_det_fk1` FOREIGN KEY (`nProduct`) REFERENCES `product` (`nRec`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8;

CREATE TRIGGER `recept_det_after_ins_tr` AFTER INSERT ON `recept_det`
  FOR EACH ROW
BEGIN
  set @Rec1=NEW.`nRecept`;
  SET @sm1=(SELECT SUM(`Val`) FROM recept_det WHERE `nRecept`=@Rec1);
  update recept set `Val`=@sm1 where `nRec`=@Rec1;
END;

CREATE TRIGGER `recept_det_after_upd_tr` AFTER UPDATE ON `recept_det`
  FOR EACH ROW
BEGIN
  set @Rec1=OLD.`nRecept`;
  SET @sm1=(SELECT SUM(`Val`) FROM recept_det WHERE `nRecept`=@Rec1);
  update recept set `Val`=@sm1 where `nRec`=@Rec1;
END;

CREATE TRIGGER `recept_det_after_del_tr` AFTER DELETE ON `recept_det`
  FOR EACH ROW
BEGIN
  set @Rec1=OLD.`nRecept`;
  SET @sm1=(SELECT SUM(`Val`) FROM recept_det WHERE `nRecept`=@Rec1);
  update recept set `Val`=@sm1 where `nRec`=@Rec1;
END;

